aboutIdentityFederationPortal:"Federacja to\u017csamo\u015bci jest w\u0142\u0105czana przez ustanowienie zaufanej relacji mi\u0119dzy korporacyjnym dostawc\u0105 to\u017csamo\u015bci a systemem Portal for ArcGIS dzia\u0142aj\u0105cym jako dostawca us\u0142ugi. Obaj dostawcy wymieniaj\u0105 informacje za po\u015brednictwem protoko\u0142u internetowego SAML2.",onceFederated:"Po wykonaniu integracji cz\u0142onkowie b\u0119d\u0105 automatycznie przekierowywani do serwer\u00f3w internetowych dzia\u0142aj\u0105cych w ramach przedsi\u0119biorstwa, kt\u00f3re umo\u017cliwiaj\u0105 im zalogowanie si\u0119 w systemie firmy. Wyniki tego logowania s\u0105 przesy\u0142ane z powrotem do systemu ArcGIS Online, kt\u00f3ry zezwala tym u\u017cytkownikom na korzystanie z w\u0142asnych zasob\u00f3w w serwisie ArcGIS Online.",
onceFederatedPortal:"Po wykonaniu integracji cz\u0142onkowie b\u0119d\u0105 automatycznie przekierowywani do serwer\u00f3w internetowych dzia\u0142aj\u0105cych w ramach przedsi\u0119biorstwa, kt\u00f3re umo\u017cliwiaj\u0105 im zalogowanie si\u0119 w systemie firmy. Wyniki tego logowania s\u0105 przesy\u0142ane z powrotem do oprogramowania Portal for ArcGIS, kt\u00f3re zezwala tym u\u017cytkownikom na korzystanie z w\u0142asnych zasob\u00f3w w Portal for ArcGIS.",useSetIdentityProvider:"Za pomoc\u0105 przycisku Skonfiguruj dostawc\u0119 to\u017csamo\u015bci mo\u017cna wprowadzi\u0107 do systemu ArcGIS Online informacje o zgodnym z protoko\u0142em SAML2 korporacyjnym dostawcy to\u017csamo\u015bci.",
