useGetServiceProviderPortal:"Za pomoc\u0105 przycisku Uzyskaj dostawc\u0119 to\u017csamo\u015bci mo\u017cna wprowadzi\u0107 do systemu korporacyjnego dostawcy to\u017csamo\u015bci informacje o systemie ArcGIS Online (w tym kontek\u015bcie: dostawca us\u0142ug).",signInSetting:"Opcje logowania",signInDesc:"Dostosuj stron\u0119 logowania ${type} tak, aby${tooltipStart}cz\u0142onkowie mogli logowa\u0107 si\u0119 za pomoc\u0105${tooltipEnd}:",signInTooltip:"Za pomoc\u0105 tej sekcji mo\u017cna dostosowa\u0107 opcje wy\u015bwietlane na stronie logowania. Je\u015bli wi\u0119kszo\u015b\u0107 cz\u0142onk\u00f3w b\u0119dzie si\u0119 logowa\u0107 za pomoc\u0105 login\u00f3w korporacyjnych ${name}, mo\u017cna w\u0142\u0105czy\u0107 tylko t\u0119 opcj\u0119 na niestandardowej stronie logowania ${type}. Administratorzy, kt\u00f3rzy chc\u0105 logowa\u0107 si\u0119 przy u\u017cyciu kont ${arcgis}, nadal mog\u0105 korzysta\u0107 z tej opcji z poziomu standardowej strony logowania ${site}.",
arcgisSignIn:"Konto ${name} lub ${portal}",enterpriseSignIn:"Tylko konto ${name}",automaticRegistration:"Automatyczna rejestracja konta",selfSignUp:"Rejestracja",multiFactorAuth:"Uwierzytelnianie wielopoziomowe",multiFactorAuthDesc:"Uwierzytelnianie wielopoziomowe zapewnia wszystkim cz\u0142onkom dysponuj\u0105cym kontami ArcGIS w instytucji dodatkowy poziom ochrony polegaj\u0105cy na wymogu wprowadzania dodatkowego kodu weryfikacyjnego podczas logowania.",multiFactorLearnMore:"Dowiedz si\u0119 wi\u0119cej o uwierzytelnianiu wielopoziomowym.",
