adminNoMfaEmail:"Ten administrator, ${user}, nie posiada skonfigurowanego adresu e-mail. Nie b\u0119dzie on m\u00f3g\u0142 otrzymywa\u0107 e-maili dotycz\u0105cych problem\u00f3w z uwierzytelnianiem wielopoziomowym.",clickAddName:"Kliknij nazw\u0119 przeznaczon\u0105 do dodania.",clickRemoveName:"Aby usun\u0105\u0107, kliknij nazw\u0119.",adminHeader:"Administratorzy",designatedAdminHeader:"Wyznaczeni administratorzy",needTwoAdminMsg:"Aby w instytucji w\u0142\u0105czy\u0107 funkcj\u0119 Uwierzytelnianie wielopoziomowe, nale\u017cy wyznaczy\u0107 co najmniej dw\u00f3ch administrator\u00f3w. Wyznacz co najmniej dw\u00f3ch administrator\u00f3w i kliknij przycisk Zapisz.",
needTwoAdminUpdateMsg:"Musisz wyznaczy\u0107 co najmniej dw\u00f3ch administrator\u00f3w, aby utrzyma\u0107 uwierzytelnianie wielopoziomowe dla Twojej instytucji. Wyznacz dw\u00f3ch lub wi\u0119cej administrator\u00f3w i kliknij Zapisz.",disableMultiFactorMsg:"Czy na pewno wy\u0142\u0105czy\u0107 funkcj\u0119 Uwierzytelnianie wielopoziomowe? Ta operacja spowoduje usuni\u0119cie dodatkowego poziomu zabezpiecze\u0144 kont cz\u0142onk\u00f3w, kt\u00f3rzy posiadaj\u0105 t\u0119 opcj\u0119. Kliknij OK i Zapisz na stronie ustawie\u0144, aby potwierdzi\u0107 t\u0119 czynno\u015b\u0107.",
